import React, { useState } from "react";
import "./Users.css";
import AddUser from "../../components/Cards/AddUser/AddUser";
import ModalUser from "../../components/Modal/ModalUser";
import UserTable from "./Table/UserTable";
import {
  MenuFoldOutlined,
  MenuUnfoldOutlined,
  UserOutlined,
  TrophyOutlined,
  HomeOutlined,
  SmileOutlined,
  ImportOutlined,
} from "@ant-design/icons";
import { Layout, Menu } from "antd";
import "../Layout/Layout.css";
import { Link } from "react-router-dom";

const PageUser = () => {
  const { Header, Sider, Content } = Layout;
  const [collapsed, setCollapsed] = useState(false);
  const [ModalUserVisible, setModalUserVisible] = useState(false);
  return (
    <div className="page-user__container">
      <div className="page-user__header">
        <div className="title_area">
          <h1 className="page-user__title">Usu√°rios</h1>
        </div>
        <a onClick={() => setModalUserVisible(true)}>
          <AddUser></AddUser>
        </a>
      </div>
      {ModalUserVisible ? (
        <ModalUser onClose={() => setModalUserVisible(false)} />
      ) : null}
      <UserTable />
    </div>
  );
};

export default PageUser;
